function App() {

    let NewComponent = React.createClass({
      render: function() {
        return (
          <div>
            <div style={{border: 'solid 1px black', maxWidth: '100vw'}}>
              <h1 className="title red">Your name here</h1>
              <br />
              <img src="/imageInSrc.jpg" />
